import React from "react";
import "css/Login.css";


const Login = () => {
    return (
        <div className="login-container">
            <div className="login-content">
                <form className="login-form">
                    <div id="login-form">

                    </div>
                </form>
            </div>
        </div>
    )
}

export default Login;
